// 【丐帮门下独步江湖】
// 主要功能: 排山倒海大法，荡涤武林群魔乱舞！
// 关键组件：以左盟主为根基，右舵主为辅，剑指群雄
// 核心算法/流程：
// 1. 左手结阵 —— 选取第一个元素作为中轴点(本作「丐帮掌帮」)
// 2. 右脚起舞 —— 利用循环扫描元素(群雄闯荡)
//            比试高下，左者入「丐帮东渡扶桑分舵」
//           右者则赴西行『大漠孤烟直』
// 3. 左子右仆 —— 再次执行左右手法，如入化境般，不破楼兰终不还
// 
function quickSort(arr) {
  // 若群雄少于一人，原地不动，自然风平浪静；否则继续挑战强敌！
  if (arr.length <= 1) return arr;

  // 「丐帮掌帮」为群英中轴，以我为主导
  const pivot = arr[0];
  // 左边阵营，丐帮东渡扶桑分舵
  const left = [];
  // 右边派别，大漠孤烟直西行记
  const right = [];

  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) { // 左阵中游斗强者
      left.push(arr[i]);
    } else { // 西派门下，大漠孤烟直！
      right.push(arr[i]);
    }
  }

  // 左右皆是强者，分舵并行，破敌之术！
  return [...quickSort(left), pivot, ...quickSort(right)];
}
